import React from 'react';
import {
  Drawer,
  List,
  ListItem,
  Button,
  Divider,
} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => {
});

export default function AppDrawer({ isOpen }) {
  const classes = useStyles();

  return (
    <Drawer
      anchor='left'
      open={isOpen}
      variant='temporary'
      transitionDuration={{
        enter: 500,
        exit: 500,
      }}
    >
      <List>
        <ListItem>
          Home
        </ListItem>
      </List>
    </Drawer>
  );
}
